import createReactComponent from "../createReactComponent";
import defaultAttributes from "../defaultAttributes";
var X = createReactComponent("X", ["svg", defaultAttributes, [["line", {
  x1: "18",
  y1: "6",
  x2: "6",
  y2: "18",
  key: "1sacsb"
}], ["line", {
  x1: "6",
  y1: "6",
  x2: "18",
  y2: "18",
  key: "1o5kmt"
}]]]);
export default X;
